import React from "react";



const AboutMe = () => {
    return (
      <div className="about-container">
        <p className="about">

          I'm a passionate newcomer to the world of programming, driven by a relentless thirst for knowledge and a commitment to mastering this ever-evolving craft. My skill set includes JavaScript, HTML/CSS, Angular, React, TypeScript, P5.js, and Nest. As an eager learner, I'm dedicated to continuous growth and problem-solving. I thrive on breaking down complex challenges and believe in the power of collaboration. I'm focused on building a strong foundation in programming, primarily in JavaScript, Angular, and React. 

        </p>
     </div> 
    )
}

export default AboutMe
